CREATE TABLE IF NOT EXISTS `GeoHashEntity`(
   `word`  VARCHAR(255) NOT NULL,
   `hashVal` VARCHAR(3) NOT NULL PRIMARY KEY
);

CREATE TABLE IF NOT EXISTS `GeoVocabPremium`(
   `magicwords`  VARCHAR(255) NOT NULL,
   `geoHash` VARCHAR(10) NOT NULL PRIMARY KEY
);

CREATE INDEX word
ON GeoHashEntity (word);

CREATE INDEX magicwords
ON GeoVocabPremium (magicwords);

